import React from 'react'
import { useState } from 'react'
import { Fragment } from 'react'
import axios from 'axios'
import HouseholdsReport from './Households/HouseholdsReport.js'


const ReportsPage = (props) => {
    const [currPage, setCurrPage] = useState();
    
    const handlePageClick = (pageName) => {
        console.log(pageName)
        if (pageName === 'households-report') setCurrPage(<HouseholdsReport handlePageClick={handlePageClick} />);
        else if (pageName === 'newUserPage') setCurrPage(<NewUserPage handlePageClick={handlePageClick} />);

    }

    // HTML structure of this component
    return (
        <Fragment>
            <h3>Generate Report</h3>
            <button onClick={() => householdClick('households-report')}>
                Households Report
            </button>
            <button onClick={() => packagingClick('reports')}>
                Packaging Report
            </button>
            <button onClick={() => handlePageClick()}>
                Cost Totals
            </button>
            <button onClick={() => handlePageClick()}>
                Menu Reports
            </button>
            <button onClick={() => handlePageClick()}>
                Purchasing Reports
            </button>
        </Fragment>
    );
}

export default ReportsPage;
